  "translationLines": [
    {
      "lineNumber": 186112,
      "originalJapaneseLine": "「なんとかって言われてもな……」",
      "translatedEnglishLine": "\"Even if you say something like that...\""
    },
    {
      "lineNumber": 186113,
      "originalJapaneseLine": "「確かに昔から友好的な奴じゃあなかったが……",
      "translatedEnglishLine": "\"It's true he hasn't been a friendly guy since long ago...\""
    },
    {
      "lineNumber": 186114,
      "originalJapaneseLine": "　それにしたって随分とやる気がないな……」",
      "translatedEnglishLine": "\"But even so, he's really unmotivated...\""
    },
    {
      "lineNumber": 186115,
      "originalJapaneseLine": "「私の楽しみと言えば、もう……",
      "translatedEnglishLine": "\"As for my pleasures, well...\""
    },
    {
      "lineNumber": 186116,
      "originalJapaneseLine": "　ここに来る客人と戯れることくらいだ」",
      "translatedEnglishLine": "\"It's just to play with the guests who come here.\""
    },
    {
      "lineNumber": 186117,
      "originalJapaneseLine": "「よいだろう。",
      "translatedEnglishLine": "\"Very well.\""
    },
    {
      "lineNumber": 186118,
      "originalJapaneseLine": "　せっかくここまで来たのだ、",
      "translatedEnglishLine": "\"Since you came all this way,\""
    },
    {
      "lineNumber": 186119,
      "originalJapaneseLine": "　一つ昔話くらいは聞かせよう」",
      "translatedEnglishLine": "\"I'll tell you at least one old story.\""
    },
    {
      "lineNumber": 186120,
      "originalJapaneseLine": "「とある男の話だ」",
      "translatedEnglishLine": "\"It is about a certain man.\""
    },
    {
      "lineNumber": 186121,
      "originalJapaneseLine": "「その男の生きる時代はひどい時代だった。",
      "translatedEnglishLine": "\"The era that man lived in was a horrible time.\""
    },
    {
      "lineNumber": 186122,
      "originalJapaneseLine": "　人は魔物に嬲られムシケラのように殺され、",
      "translatedEnglishLine": "\"People were tormented by monsters and killed like insects,\""
    },
    {
      "lineNumber": 186123,
      "originalJapaneseLine": "　それに対抗する手段もなにもない時代」",
      "translatedEnglishLine": "\"It was an era without any means to resist.\""
    },
    {
      "lineNumber": 186124,
      "originalJapaneseLine": "「その男はとある男に誘われて、",
      "translatedEnglishLine": "\"That man was invited by another man,\""
    },
    {
      "lineNumber": 186125,
      "originalJapaneseLine": "　そんな世界を良くする為の冒険に同行した」",
      "translatedEnglishLine": "\"to accompany him on an adventure to improve such a world.\""
    },
    {
      "lineNumber": 186126,
      "originalJapaneseLine": "「戦士ブリティシュのもとに集った……",
      "translatedEnglishLine": "\"They gathered under the warrior British...\""
    },
    {
      "lineNumber": 186127,
      "originalJapaneseLine": "　冒険者達さ」",
      "translatedEnglishLine": "\"the adventurers.\""
    },
    {
      "lineNumber": 186128,
      "originalJapaneseLine": "「お前らのことか」",
      "translatedEnglishLine": "\"You guys mean?\""
    },
    {
      "lineNumber": 186129,
      "originalJapaneseLine": "「ああ、そうだ」",
      "translatedEnglishLine": "\"Yes, that's right.\""
    },
    {
      "lineNumber": 186130,
      "originalJapaneseLine": "「そして男達……いや、私達は……",
      "translatedEnglishLine": "\"And those men... no, we...\""
    },
    {
      "lineNumber": 186131,
      "originalJapaneseLine": "　長い冒険の末……」",
      "translatedEnglishLine": "\"after a long adventure...\""
    },
    {
      "lineNumber": 186132,
      "originalJapaneseLine": "「1500年前……神に会った……」",
      "translatedEnglishLine": "\"1500 years ago... met a god...\""
    },
    {
      "lineNumber": 186133,
      "originalJapaneseLine": "「その神は言ったよ。",
      "translatedEnglishLine": "\"That god said.\""
    },
    {
      "lineNumber": 186134,
      "originalJapaneseLine": "　一人につき願い事を一つ叶えようと」",
      "translatedEnglishLine": "\"I will grant one wish to each person.\""
    },
    {
      "lineNumber": 186135,
      "originalJapaneseLine": "「だから、私達は求めた」",
      "translatedEnglishLine": "\"So, we wished for...\""
    },
    {
      "lineNumber": 186136,
      "originalJapaneseLine": "「カオスと日光は力を」",
      "translatedEnglishLine": "\"Chaos and Nichiko for power.\""
    },
    {
      "lineNumber": 186137,
      "originalJapaneseLine": "「カフェは美を」",
      "translatedEnglishLine": "\"Cafe for beauty.\""
    },
    {
      "lineNumber": 186138,
      "originalJapaneseLine": "「そして私は……全知を」",
      "translatedEnglishLine": "\"And I... for omniscience.\""
    },
    {
      "lineNumber": 186139,
      "originalJapaneseLine": "「私は神の力で……",
      "translatedEnglishLine": "\"With the power of the god...\""
    },
    {
      "lineNumber": 186140,
      "originalJapaneseLine": "　確かにすべての知識を得た。",
      "translatedEnglishLine": "\"I indeed obtained all knowledge.\""
    },
    {
      "lineNumber": 186141,
      "originalJapaneseLine": "　そして、不死の体も」",
      "translatedEnglishLine": "\"And an immortal body as well.\""
    },
    {
      "lineNumber": 186142,
      "originalJapaneseLine": "「すべてを知った」",
      "translatedEnglishLine": "\"I knew everything.\""
    },
    {
      "lineNumber": 186143,
      "originalJapaneseLine": "「ふーん、その神、",
      "translatedEnglishLine": "\"Hmm, that god,\""
    },
    {
      "lineNumber": 186144,
      "originalJapaneseLine": "　ちゃんと約束は守ったのか。",
      "translatedEnglishLine": "\"Did keep the promise properly?\""
    },
    {
      "lineNumber": 186145,
      "originalJapaneseLine": "　良かったではないか」",
      "translatedEnglishLine": "\"Isn't that good?\""
    },
    {
      "lineNumber": 186146,
      "originalJapaneseLine": "「ふふ、ふふ……」",
      "translatedEnglishLine": "\"Heh heh, heh heh...\""
    },
    {
      "lineNumber": 186147,
      "originalJapaneseLine": "「それが如何に残酷で……",
      "translatedEnglishLine": "\"You can't even imagine how cruel and...\""
    },
    {
      "lineNumber": 186148,
      "originalJapaneseLine": "　つまらない話か想像もつくまいね」",
      "translatedEnglishLine": "\"boring this story is.\""
    },
    {
      "lineNumber": 186149,
      "originalJapaneseLine": "「人は知らぬことがあるから",
      "translatedEnglishLine": "\"People can live happily because there are things they don't know.\""
    },
    {
      "lineNumber": 186150,
      "originalJapaneseLine": "　楽しく生きられるのだ」",
      "translatedEnglishLine": "\"It allows them to enjoy life.\""
    },
    {
      "lineNumber": 186151,
      "originalJapaneseLine": "「知識欲をもつこと……",
      "translatedEnglishLine": "\"Having a thirst for knowledge...\""
    },
    {
      "lineNumber": 186152,
      "originalJapaneseLine": "　好奇心、夢を持つことで生きられる」",
      "translatedEnglishLine": "\"living by possessing curiosity and dreams.\""
    },
    {
      "lineNumber": 186153,
      "originalJapaneseLine": "「すべてを知った私には、",
      "translatedEnglishLine": "\"For me who knows everything,\""
    },
    {
      "lineNumber": 186154,
      "originalJapaneseLine": "　もう新しい刺激も何もなかった」",
      "translatedEnglishLine": "\"there was no new excitement or anything left.\""
    },
    {
      "lineNumber": 186155,
      "originalJapaneseLine": "「この世全ての知識は人の身には",
      "translatedEnglishLine": "\"All the knowledge of this world is too much\""
    },
    {
      "lineNumber": 186156,
      "originalJapaneseLine": "　あまりに多く、そして重い……」",
      "translatedEnglishLine": "\"too much and too heavy for a person...\""
    },
    {
      "lineNumber": 186157,
      "originalJapaneseLine": "「すべてを知った途端、",
      "translatedEnglishLine": "\"The moment I knew everything,\""
    },
    {
      "lineNumber": 186158,
      "originalJapaneseLine": "　私は何も興味を持つことが",
      "translatedEnglishLine": "\"I became unable to be interested in anything,\""
    },
    {
      "lineNumber": 186159,
      "originalJapaneseLine": "　出来なくなってしまった」",
      "translatedEnglishLine": "\"completely.\""
    },
    {
      "lineNumber": 186160,
      "originalJapaneseLine": "「魔人も……魔王のことも……」",
      "translatedEnglishLine": "\"Demons... the Demon King...\""
    },
    {
      "lineNumber": 186161,
      "originalJapaneseLine": "「すべての予定調和……",
      "translatedEnglishLine": "\"All preordained harmony...\""
    },
    {
      "lineNumber": 186162,
      "originalJapaneseLine": "　すべての設定……」",
      "translatedEnglishLine": "\"all settings...\""
    },
    {
      "lineNumber": 186163,
      "originalJapaneseLine": "「すべてもう……知ってしまった……」",
      "translatedEnglishLine": "\"I already know everything...\""
    },
    {
      "lineNumber": 186164,
      "originalJapaneseLine": "「この世の端から端までね……」",
      "translatedEnglishLine": "\"From one end of this world to the other...\""
    },
    {
      "lineNumber": 186165,
      "originalJapaneseLine": "「希望がないことを絶望というなら、",
      "translatedEnglishLine": "\"If having no hope is called despair,\""
    },
    {
      "lineNumber": 186166,
      "originalJapaneseLine": "　これもまた絶望の形だろうね」",
      "translatedEnglishLine": "\"then this must be another form of despair.\""
    },
    {
      "lineNumber": 186167,
      "originalJapaneseLine": "「以来、私は何をするでもなくここにいる」",
      "translatedEnglishLine": "\"Since then, I have been here doing nothing.\""
    },
    {
      "lineNumber": 186168,
      "originalJapaneseLine": "「これが……私が協力する気はないと言う理由だ」",
      "translatedEnglishLine": "\"This is why... I say I have no intention of cooperating.\""
    },
    {
      "lineNumber": 186169,
      "originalJapaneseLine": "「世界もなにもかも……",
      "translatedEnglishLine": "\"The world and everything else...\""
    },
    {
      "lineNumber": 186170,
      "originalJapaneseLine": "　私にはどうでもいいのさ」",
      "translatedEnglishLine": "\"It doesn't matter to me at all.\""
    },
    {
      "lineNumber": 186171,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    }
  ]
}

